    [],nt"revision_timestamp": "2016-07-27T22:23:15.143719",nt"name": "mingo-national-wildlife-refuge-annual-narrative-report-includes-pilot-knob-national-wildli-0b597",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Mingo
    National Wildlife Refuge summarizes refuge activities during fiscal year 1997. The
    report begins with an introduction to the refuge and a summary of the yearu2019s
    highlights and climatic conditions.  Information about monitoring and studies- including
    waterfowl and marsh birds - is provided next.  Habitat restoration and management
    projects are also covered; activities include wetland and upland restoration, water
    level management, and grazing.  Fish and wildlife management is discussed next with
    emphasis on bird banding and predator control. Coordination activities, such as
    agency partnerships and private land activities are outlined.  The resource protection
    section provides information about law enforcement, cultural resources management,
    and land acquisition.  Information about public education and recreation is given
    including visitor services and outreach programs.  Finally, refuge planning and
    administration are discussed.",nt"license_title": "License Not Specified",nt"extras":
